import React from 'react';
import AliceCarousel from 'react-alice-carousel';
import "react-alice-carousel/lib/alice-carousel.css"
import "./Slider.css"

const Slider = () => {
    return (
        <div className='slider'>
            <div className='container-slider'>
                <div className='slider-div'>
                <AliceCarousel autoPlay={true}  autoPlayInterval="3000" autoPlayStrategy='none' infinite="true" disableButtonsControls={true} >
                        <img src="https://media.discordapp.net/attachments/979601812472598619/984642356148064266/unknown.png?width=1920&height=802" alt="slide One" />
                        <img src="https://media.discordapp.net/attachments/979601812472598619/984642356148064266/unknown.png?width=1920&height=802" alt="slide One" />
                        <img src="https://media.discordapp.net/attachments/979601812472598619/984642356148064266/unknown.png?width=1920&height=802" alt="slide One" />
                </AliceCarousel>
                </div>
            </div>
        </div>
    );
};
export default Slider;
